package com.abc.apptracnghiem.Question;public class TypeQuestion {    private int id;    private String name;    private String typeQuestion;    public TypeQuestion() {    }    public TypeQuestion(int id, String name, String typeQuestion) {        this.id = id;        this.name = name;        this.typeQuestion = typeQuestion;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getTypeQuestion() {        return typeQuestion;    }    public void setTypeQuestion(String typeQuestion) {        this.typeQuestion = typeQuestion;    }}